import React from 'react';
import { Col, Container, Row } from 'reactstrap';
import CatalogItems from './components/CatalogItems';
import ParkSelect from './components/ParkSelect';

const DiscoverParks = () => (
  <Container>
    <Row>
      <Col md={12}>
        <br />
        <h3 className="page-title">รายการสวนในระบบ</h3>
        <h3 className="page-subhead subhead">รายการแสดงสวนสาธารณะในระบบ
        </h3>
      </Col>
    </Row>
    <Row>
      <Col md={12}>
        <div className="form__form-group-field">
          <ParkSelect
            options={[
              {
                value: 'Pink Sugar',
                label: 'Pink Sugar',
                color: '#f7a9c4',
              },
              {
                value: 'Pink Sugar',
                label: 'Pink Sugar',
                color: '#f7a9c4',
              },
              {
                value: 'Pink Sugar',
                label: 'Pink Sugar',
                color: '#f7a9c4',
              },
            ]}
          />
        </div>
      </Col>
      <CatalogItems />
    </Row>
  </Container>
);

export default DiscoverParks;
